import { useState } from "react";

const Prices = (props) => {
  const [currency, setCurrency] = useState("USD");

  const renderPrices = () => {
    switch (currency) {
      case "USD":
        return <ul className="list-group"></ul>;
      default:
        return <div>Buy Guys</div>;
    }
  };

  return <div>{renderPrices()}</div>;
};

export default Prices;
